import { NavLink } from "react-router-dom";

const Navigation = (Props) => {
  return (
    <div>
      <ul>
        <li>
          <NavLink to="/gallery/mars-rover">Mars Rover</NavLink>
        </li>
        <li>
          <NavLink to="/gallery/apod">APOD</NavLink>
        </li>
      </ul>
    </div>
  );
};

export default Navigation;
